import React, { memo } from 'react';
import { Popup } from '../';
import styles from './ProductСreate.module.css';
import cn from 'classnames';

export const ProductСreate = memo(({ className, opened }) => {
    return (
        <Popup opened={opened} title="Добавить продукт">
            <form className={cn(styles.form, className)} method="post" action="#" >
                <label className="popup__labal" htmlFor="email">Email</label>
                <input name="email" className="popup__input" type="email" placeholder="Введите почту" required/>
                <span className={`popup__span-error`}>12</span>
            </form>
        </Popup>
    );
});
